import React, {Component}from "react";
import ReactDOM from "react-dom";


const Card = (props) =>{
        return( 
            <div className="bg-light-green dib br3 ma2 grow shadow-5">
                <img src={props.image} alt="profile-image"/>

            <div>
                <h2>{props.name}</h2>
                <p>{props.series}</p>
            </div>
        </div>

    )

}

export default Card
